import React from 'react';
import 'bootstrap/dist/css/bootstrap.min.css'; // Import Bootstrap CSS
import './Login.css';

const Login = () => {
  return (
    <div className='container'>
      <div className='row justify-content-center'>
        <div className='col-md-6'>
          <div className='login'>
            <h3 className='textlogin'>Log in to Adhiraj-property</h3>
            <form className='loginform'>
              <div className='form-group'>
                <label htmlFor='email' style={{ fontSize: '24px', color: 'darkblue' }}>
                  Email:
                </label>
                <input
                  type='email'
                  className='form-control'
                  id='email'
                  placeholder='Enter your email'
                />
              </div>
              <div className='form-group'>
                <label htmlFor='password' style={{ fontSize: '24px', color: 'darkblue' }}>
                  Password:
                </label>
                <input
                  type='password'
                  className='form-control'
                  id='password'
                  placeholder='Enter your Password'
                />
              </div>
              <div className='form-check'>
                <input type='checkbox' className='form-check-input' id='rememberMe' />
                <label
                  className='form-check-label'
                  htmlFor='rememberMe'
                  style={{ fontSize: '18px', color: 'black' }}
                >
                  Keep me logged in
                </label>
              </div>
              <button type='button' className='btn btn-primary loginbutton'>
                Login
              </button>
            </form>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Login;
